Daredevil Road Warrior #1 [MARVEL 2014]

What rattles the Man Without Fear is more than a fight with Man Bull? Several hours in the heightened senses hell of a cross country flight. Particularly when it includes and inexplicable passenger. Digital comics masters Mark Waid (Daredevil, Insufferable) and Peter Krause (Insufferable) bring you the first leg in Daredevils journey to a new life (And a new series)!


*** Enjoy and Please SEED ***


There are way too many great uploaders to list anymore :) Search TPB Comics and you'll find almost anything you want. Thanks to everyone for making this such a friendly place. Other parts of TPB, people start flame wars and constant competition, here under Comics, we have a Utopia of Comic sharing. If you have the money and opportunity please buy independent comics - keep em going!



